  true,\n\t\"url\": null,\n\t\"notes\": \"SolRad-Net (Solar Radiation Network) is
  an established network of ground-based sensors providing high-frequency solar flux
  measurements in quasi-realtime to the scientific community and various other end
  users. This network was implemented as a companion to AERONET and its instrumentation
  are invariably collocated with AERONET sites.  The Brazilian core of the present
  network was developed within the scientific framework of the LBA-ECO component of
  the Large-Scale Biosphere-Atmosphere Experiment in Amazu00f4nia. Historically, SolRad-Nethas
  preferentially selected sites that routinely experience intervals of biomass-burning,
  such as Amazu00f4nia and Sub-Saharan Africa for its long-term monitoring. Data that
  have been cleared as free of any operational problems are designated as Level 1.5.
  The raw, unscreened data are Level 1.0 by default and may contain observations that
  have been compromised for any of the (occasionally subtle) reasons described above.
  The Level 1.0 data are made available in the interest of presenting a comprehensive
  \ dataset and to provide full transparency of our methods, however any use of these
  data is strongly discouraged. Data are available from several flux instruments including
  filtered and unfiltered pyranometers, photosynthetically active radiation (PAR)
  energy and quantum sensors, and UV-A and UV-B flux sensors. To maintain the integrity
  of the database and fairness to the individuals who have contributed, use of these
  data for publication requires an offer of authorship to the SolRad-Net PI(s).\",\n\t\"license_title\":
